import React from 'react';
import Header from './Header';
import Body from './Body';
import Category3DGraphic from '../components/Category3DGraphic';
import StartPage from '../StartPage';
const Home = () => {
    return (
        <div>
            <Header />
            <Body />
            <Category3DGraphic />
        </div>
    );
}

export default Home;
